contracts/DoctorManagement.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;


interface IPatientDataManagement {
    function grantDoctorAccess(address _doctor, address _patient) external;
    function revokeDoctorAccess(address _doctor, address _patient) external;
    function getPatientRecord(address _patient) external view returns (string memory);
}

contract DoctorManagement {
    address public admin;
    IPatientDataManagement public patientDataContract;
    
    struct Doctor {
        string name;
        string specialization;
        bool isVerified;
    }

    mapping(address => Doctor) public doctors;
    mapping(address => bool) public registeredDoctors;
    
    event DoctorRegistered(address indexed doctor, string name, string specialization);
    event DoctorVerified(address indexed doctor);
    event AccessRequested(address indexed doctor, address indexed patient);
    event AccessRevoked(address indexed doctor, address indexed patient);

    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this action");
        _;
    }

    modifier onlyVerifiedDoctor() {
        require(doctors[msg.sender].isVerified, "Doctor is not verified");
        _;
    }

    constructor(address _patientDataContract) {
        admin = msg.sender;
        patientDataContract = IPatientDataManagement(_patientDataContract);
    }

    function registerDoctor(string memory _name, string memory _specialization) external {
        require(!registeredDoctors[msg.sender], "Doctor already registered");
        doctors[msg.sender] = Doctor(_name, _specialization, false);
        registeredDoctors[msg.sender] = true;
        emit DoctorRegistered(msg.sender, _name, _specialization);
    }

    function verifyDoctor(address _doctor) external onlyAdmin {
        require(registeredDoctors[_doctor], "Doctor is not registered");
        doctors[_doctor].isVerified = true;
        emit DoctorVerified(_doctor);
    }

    function requestAccessToPatient(address _patient) external onlyVerifiedDoctor {
        patientDataContract.grantDoctorAccess(msg.sender, _patient);
        emit AccessRequested(msg.sender, _patient);
    }

    function revokeAccessFromPatient(address _patient) external onlyVerifiedDoctor {
        patientDataContract.revokeDoctorAccess(msg.sender, _patient);
        emit AccessRevoked(msg.sender, _patient);
    }

    function viewPatientRecord(address _patient) external view onlyVerifiedDoctor returns (string memory) {
        return patientDataContract.getPatientRecord(_patient);
    }
}

contracts/PatientDataManagement.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract PatientDataManagement {
    struct HealthData {
        uint256 timestamp;
        uint256 glucoseLevel;
        bytes32 medicationHash;
        bytes32 mealsHash;
        bytes32 exerciseHash;
    }

    mapping(address => HealthData[]) private patientData;
    mapping(address => mapping(address => bool)) private accessPermissions;
    mapping(address => bool) private emergencyAccessors;
    address private owner;

    event DataLogged(address indexed patient, uint256 timestamp, uint256 glucoseLevel, bytes32 medicationHash, bytes32 mealsHash, bytes32 exerciseHash);
    event AccessUpdated(address indexed patient, address indexed accessor, bool isGranted);
    event EmergencyAccessUpdated(address indexed accessor, bool isGranted);

    modifier onlyPatient(address _patient) {
        require(_patient == msg.sender, "Only the patient can perform this action");
        _;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only the owner can perform this action");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    function logHealthData(
        uint256 _glucoseLevel,
        bytes32 _medicationHash,
        bytes32 _mealsHash,
        bytes32 _exerciseHash
    ) public {
        HealthData memory newData = HealthData({
            timestamp: block.timestamp,
            glucoseLevel: _glucoseLevel,
            medicationHash: _medicationHash,
            mealsHash: _mealsHash,
            exerciseHash: _exerciseHash
        });
        patientData[msg.sender].push(newData);
        emit DataLogged(msg.sender, block.timestamp, _glucoseLevel, _medicationHash, _mealsHash, _exerciseHash);
    }

    function updateAccess(address _accessor, bool _isGranted) public onlyPatient(msg.sender) {
        accessPermissions[msg.sender][_accessor] = _isGranted;
        emit AccessUpdated(msg.sender, _accessor, _isGranted);
    }

    function grantEmergencyAccess(address _accessor) public onlyOwner {
        emergencyAccessors[_accessor] = true;
        emit EmergencyAccessUpdated(_accessor, true);
    }

    function revokeEmergencyAccess(address _accessor) public onlyOwner {
        emergencyAccessors[_accessor] = false;
        emit EmergencyAccessUpdated(_accessor, false);
    }

    function viewHealthData(address _patient) public view returns (HealthData[] memory) {
        require(
            _patient == msg.sender || accessPermissions[_patient][msg.sender] || emergencyAccessors[msg.sender],
            "Access not authorized"
        );
        return patientData[_patient];
    }

    function deleteHealthData(uint256 _index) public {
        require(_index < patientData[msg.sender].length, "Invalid index");
        delete patientData[msg.sender][_index];
    }

    function getAverageGlucoseLevel(address _patient, uint256 _startTime, uint256 _endTime) public view returns (uint256) {
        require(
            _patient == msg.sender || accessPermissions[_patient][msg.sender],
            "Access not authorized"
        );
        uint256 total = 0;
        uint256 count = 0;
        for (uint256 i = 0; i < patientData[_patient].length; i++) {
            if (patientData[_patient][i].timestamp >= _startTime && patientData[_patient][i].timestamp <= _endTime) {
                total += patientData[_patient][i].glucoseLevel;
                count++;
            }
        }
        require(count > 0, "No data in the specified range");
        return total / count;
    }
}

contracts/ResearcherManagement.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;


interface IPatientDataManagement {
    function grantResearcherAccess(address _researcher) external;
    function revokeResearcherAccess(address _researcher) external;
    function getAnonymizedPatientData() external view returns (string memory);
}

contract ResearcherManagement {
    address public admin;
    IPatientDataManagement public patientDataContract;
    
    struct Researcher {
        string name;
        string institution;
        bool isVerified;
    }

    mapping(address => Researcher) public researchers;
    mapping(address => bool) public registeredResearchers;
    
    event ResearcherRegistered(address indexed researcher, string name, string institution);
    event ResearcherVerified(address indexed researcher);
    event AccessGranted(address indexed researcher);
    event AccessRevoked(address indexed researcher);

    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this action");
        _;
    }

    modifier onlyVerifiedResearcher() {
        require(researchers[msg.sender].isVerified, "Researcher is not verified");
        _;
    }

    constructor(address _patientDataContract) {
        admin = msg.sender;
        patientDataContract = IPatientDataManagement(_patientDataContract);
    }

    function registerResearcher(string memory _name, string memory _institution) external {
        require(!registeredResearchers[msg.sender], "Researcher already registered");
        researchers[msg.sender] = Researcher(_name, _institution, false);
        registeredResearchers[msg.sender] = true;
        emit ResearcherRegistered(msg.sender, _name, _institution);
    }

    function verifyResearcher(address _researcher) external onlyAdmin {
        require(registeredResearchers[_researcher], "Researcher is not registered");
        researchers[_researcher].isVerified = true;
        emit ResearcherVerified(_researcher);
    }

    function requestAccess() external onlyVerifiedResearcher {
        patientDataContract.grantResearcherAccess(msg.sender);
        emit AccessGranted(msg.sender);
    }

    function revokeAccess() external onlyVerifiedResearcher {
        patientDataContract.revokeResearcherAccess(msg.sender);
        emit AccessRevoked(msg.sender);
    }

    function viewAnonymizedData() external view onlyVerifiedResearcher returns (string memory) {
        return patientDataContract.getAnonymizedPatientData();
    }
}

